	<style data-url="//qzonestyle.gtimg.cn/qz-proj/wy-h5/g-retina-border.css">
		.bBor,
		.lBor,
		.rBor,
		.tBor,
		.trblBor {
			position: relative
		}

		.bBor:after,
		.tBor:before {
			position: absolute;
			content: "";
			height: 1px;
			background: #a2a2a0;
			left: 0;
			right: 0
		}

		.tBor:before {
			top: 0
		}

		.bBor:after {
			bottom: 0
		}

		.lBor:before,
		.rBor:after {
			position: absolute;
			content: "";
			width: 1px;
			background: #a2a2a0;
			top: 0;
			bottom: 0
		}

		.lBor:before {
			left: 0
		}

		.rBor:after {
			right: 0
		}

		.trblBor:after {
			position: absolute;
			content: "";
			top: 0;
			left: 0;
			-webkit-box-sizing: border-box;
			box-sizing: border-box;
			width: 100%;
			height: 100%;
			border: 1px solid #a2a2a0;
			point-events: none
		}

		@media (min--moz-device-pixel-ratio:1.5),
		(-webkit-min-device-pixel-ratio:1.5),
		(min-device-pixel-ratio:1.5),
		(min-resolution:144dpi),
		(min-resolution:1.5dppx),
		(-ms-high-contrast:active),
		(-ms-high-contrast:none) {

			.bBor:after,
			.tBor:before {
				-webkit-transform: scaleY(.5);
				transform: scaleY(.5)
			}

			.lBor:before,
			.rBor:after {
				-webkit-transform: scaleX(.5);
				transform: scaleX(.5)
			}

			.trblBor:after {
				width: 200%;
				height: 200%;
				-webkit-transform: scale(.5);
				transform: scale(.5)
			}

			.lBor:before,
			.tBor:before,
			.trblBor:after {
				-webkit-transform-origin: 0 0;
				transform-origin: 0 0
			}

			.bBor:after,
			.rBor:after {
				-webkit-transform-origin: 100% 100%;
				transform-origin: 100% 100%
			}
		}

		@media (-webkit-device-pixel-ratio:1.5) {

			.bBor:after,
			.tBor:before {
				-webkit-transform: scaleY(.66666666);
				transform: scaleY(.66666666)
			}

			.lBor:before,
			.rBor:after {
				-webkit-transform: scaleX(.66666666);
				transform: scaleX(.66666666)
			}

			.trblBor:after {
				width: 150%;
				height: 150%;
				-webkit-transform: scale(.66666666);
				transform: scale(.66666666)
			}
		}

		@media (-webkit-device-pixel-ratio:3) {

			.bBor:after,
			.tBor:before {
				-webkit-transform: scaleY(.3333);
				transform: scaleY(.3333)
			}

			.lBor:before,
			.rBor:after {
				-webkit-transform: scaleX(.3333);
				transform: scaleX(.3333)
			}

			.trblBor:after {
				width: 300%;
				height: 300%;
				-webkit-transform: scale(.3333);
				transform: scale(.3333)
			}
		}

		/* kaka:161011102849,yiyingludeMac2 */
	</style>

			let loadedImages = 0;
